<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Peanut-Wooju Game</title>
    <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.0.2/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-EVSTQN3/azprG1Anm3QDgpJLIm9Nao0Yz1ztcQTwFspd3yD65VohhpuuCOmLASjC" crossorigin="anonymous">

    
        <!-- Open Graph data -->
        <meta property="og:title" content="Peanut - Wooju Game" />
        <meta property="og:type" content="app" />
        <meta property="og:url" content="" />
        <meta property="og:image" content="/public/peanut.png" />
        <meta property="og:description" content="Happy Peanut Day!" />
        <meta property="og:site_name" content="Peanut - Wooju Game" />
        

    <style>

        .header{
            background: rgb(131,58,180);
            background: linear-gradient(90deg, rgba(131,58,180,1) 26%, rgba(253,29,29,1) 56%, rgba(252,176,69,1) 82%);color: #FFFFFF;
            color: #FFFFFF;
        }

        .board{
            width:100%;
            
            border-collapse: collapse;
        }

        .board td{
            height: 100px;
            min-height: 100px;
            width: 100px;
            min-width: 100px;
            text-align: center;
        }

        .selected {
            border: solid 1px red;
        }

        td{
            border: solid 1px rgb(255, 255, 255);
        }

        table{
            background-image:  url('data:image/webp;base64,')
        }
        
    </style>
</head>
<body>
    <div class="header">
    <div class="text-center">
        <h1>Peanut & Wooju Game</h1>
        <hr>
    </div>
   
    <div class="container">
        <div class="row">
           
            <div class="col text-center" id="player1_turn">
                <h3 id="player_1_turn" style="display: none;" >
                    
                    Peanut's Turn
                </h3>
                <h3 id="player_2_turn" style="display: none;" >
                 
                    Wooju's Turn
                </h3>
                <br><br>
            </div>
        </div>
    </div>
    </div>
    <br>
    <div class="container">
        <div class="row">
            <div class="col text-start">
                Peanut's Bet<br>
               <img id="player_1_gift" style="display:none" src="/public/gift.svg" width="50px"/>
            </div>
            <div class="col text-end">
                Wooju's Bet<br>
                <img id="player_2_gift" style="display:none" src="/public/gift.svg" width="50px"/>
            </div>
        </div>
        <br>
        <div class="row">
            <div class="col" id="app"></div>
        </div>
        
        <br>
        <div class="row">
            <div class="col text-start">
                <button id="reset" class="btn btn-secondary">Reset</button>
            </div>
            <div class="col text-end">
                <input type="file" id="betFile" class="d-none" accept="image/*;capture=camera"/>
                <button id="betBtn" class="btn btn-primary">Bet </button>
            </div>
        </div>
        <br>
        <div class="row">
            <div class="col">
                <div id="options1"></div>
                <div id="options2"></div>
            </div>
        </div>
        
      
        
    </div>

    <div id="myModal" class="modal" tabindex="-1">
        <div class="modal-dialog">
          <div class="modal-content">
            <div class="modal-header">
              <h5 class="modal-title" id="modalTitle"></h5>
              <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
            </div>
            <div class="modal-body text-center" id="modalBody">
              <p>Modal body text goes here.</p>
            </div>
            <div class="modal-footer">
              <a type="button" id="download" href="" class="btn btn-primary" download="prize">Download</a>
            </div>
          </div>
        </div>
      </div>
      
      <audio  id="boing" src="/public/boing.mp3" style="display: none;"></audio>
      <audio  id="woof" src="/public/woof.mp3" style="display: none;"></audio>
      <audio  id="win" src="/public/win.mp3" style="display: none;"></audio>
      <audio  id="lose" src="/public/lose.mp3" style="display: none;"></audio>


    <script src="https://cdn.jsdelivr.net/npm/bootstrap@5.0.2/dist/js/bootstrap.bundle.min.js" integrity="sha384-MrcW6ZMFYlzcLA8Nl+NtUVF0sA7MsXsP1UyJoMp4YLEuNSfAP+JcXn/tWtIaxVXM" crossorigin="anonymous"></script>

    <script type="text/javascript" src="https://cdn.jsdelivr.net/npm/js-confetti@0.10.2/dist/js-confetti.browser.js"></script>
    <script type="module">
    // Initialize Firebase
    (async () => {

        let corgiBlob = await fetch(" data:image/png;base64,")
        .then(res => { return res.blob() });
       
        let peanutBlob = await fetch(" data:image/png;base64,")
        .then(res => { return res.blob() });

        let urlCorgi = URL.createObjectURL(corgiBlob);
        let urlPeanut = URL.createObjectURL(peanutBlob);

        const pieces        = {};
        const pop           = {};
        let player        = 'player2';
        const jsConfetti    = new JSConfetti();

        const page            = document.querySelector('#app');
        const options1         = document.querySelector('#options1');
        const options2         = document.querySelector('#options2');
        const resetBtn        = document.querySelector('#reset');
        const modalTitle      = document.querySelector('#modalTitle');
        const modalBody       = document.querySelector('#modalBody');
        const betBtn          = document.querySelector('#betBtn');
        const betFile         = document.querySelector('#betFile');
        const player_1_turn   = document.querySelector('#player_1_turn');
        const player_2_turn   = document.querySelector('#player_2_turn');
        const downloadBtn     = document.querySelector('#download');
        const boing           = document.querySelector('#boing');
        const woof            = document.querySelector('#woof');
        const win               = document.querySelector('#win');
        const lose            = document.querySelector('#lose');
        const player_1_gift   = document.querySelector('#player_1_gift');
        const player_2_gift   = document.querySelector('#player_2_gift');
        let myModal           = new bootstrap.Modal(document.getElementById('myModal'), page)
        let selectedPieces    = null;
        let selectedTile      = null;
        let interval          = null;
        
        let state             = {
            turn: 'player2',
            row1:['','',''],
            row2:['','',''],
            row3:['','',''],
            player_1_options: ['X1','X2','X3','X4','X5','X6'],
            player_2_options: ['O1','O2','O3','O4','O5','O6'],
        };
        

        

        function isMyTurn(){
            console.log(state.turn, player);
            if(state.turn == player) return true;
            return false;
        }

        function canBeReplaced(a,b){

            //Primary
            let a_type = a.charAt(0);
            let a_rank = a.charAt(1);

            let b_type = b.charAt(0);
            let b_rank = b.charAt(1);

            if(a_type != b_type && a_rank > b_rank){
                return true;
            }

            return false;
        }


        function winningCondition(){

            let condition = [
                ['11','12','13'],
                ['21','22','23'],
                ['31','32','33'],
                ['11','21','31'],
                ['12','22','32'],
                ['13','23','33'],
                ['11','22','33'],
                ['13','22','31']
            ];

            let winner = false; 

            
            condition.map(con=>{

                let status = '';

                con.map((tile)=>{

                    let row = tile.charAt(0);
                    let col = tile.charAt(1);

                    let value = state['row'+row][col-1].charAt(0);

                    status += value;
                });

                if(status == 'XXX'){
                    winner = 'player_1';
                }else if(status == 'OOO'){
                    winner = 'player_2';
                }
            });


            return winner;
        }

        function selectTile(){  
                    
            if(selectedPieces){

                let row = this.row;
                let col = this.col;

                if(!canBeReplaced(selectedPieces.code,state['row'+row][col-1])){

                    alert('Only bigger pieces can eat the smaller pieces');
                    return false;
                }

                //Set piece to tile
                state['row'+row][col-1] = selectedPieces.code;
                
                //Remove Piece from options
                if(player == state.player_1){
                    
                    const index = state.player_1_options.indexOf(selectedPieces.code);
                    
                    if (index > -1) {
                        state.player_1_options.splice(index, 1);
                    }
                }else{
                    const index = state.player_2_options.indexOf(selectedPieces.code);
                    
                    if (index > -1) {
                        state.player_2_options.splice(index, 1);
                    }
                }

                if(state.turn == 'player1'){
                    state.turn = 'player2';
                }else{
                    state.turn = 'player1';
               
                }


                selectedPieces.classList.remove('selected');
                selectedPieces = null;

                g();

            }else{
                console.log(isMyTurn());
            }
        }


        reset.onclick = ()=>{

            if(confirm('Are you sure you want to reset the game?')){
                document.location.reload();
            }
        }
        
       
        
        pop.peanut1 = document.createElement('img');
        pop.peanut2 = document.createElement('img');
        pop.peanut3 = document.createElement('img');
        pop.peanut4 = document.createElement('img');
        pop.peanut5 = document.createElement('img');
        pop.peanut6 = document.createElement('img');

        pop.peanut1.src = urlPeanut;
        pop.peanut2.src = urlPeanut;
        pop.peanut3.src = urlPeanut;
        pop.peanut4.src = urlPeanut;
        pop.peanut5.src = urlPeanut;
        pop.peanut6.src = urlPeanut;

        pop.peanut1.width = 50;
        pop.peanut2.width = 60;
        pop.peanut3.width = 70;
        pop.peanut4.width = 80;
        pop.peanut5.width = 90;
        pop.peanut6.width = 100;

        pieces.X1 = pop.peanut1;
        pieces.X2 = pop.peanut2;
        pieces.X3 = pop.peanut3;
        pieces.X4 = pop.peanut4;
        pieces.X5 = pop.peanut5;
        pieces.X6 = pop.peanut6;

        pieces.X1.code = 'X1';
        pieces.X2.code = 'X2';
        pieces.X3.code = 'X3';
        pieces.X4.code = 'X4';
        pieces.X5.code = 'X5';
        pieces.X6.code = 'X6';

        
        pop.corgi1 = document.createElement('img');
        pop.corgi2 = document.createElement('img');
        pop.corgi3 = document.createElement('img');
        pop.corgi4 = document.createElement('img');
        pop.corgi5 = document.createElement('img');
        pop.corgi6 = document.createElement('img');

        pop.corgi1.src =  urlCorgi;
        pop.corgi2.src =  urlCorgi;
        pop.corgi3.src =  urlCorgi;
        pop.corgi4.src =  urlCorgi;
        pop.corgi5.src =  urlCorgi;
        pop.corgi6.src =  urlCorgi;

        pop.corgi1.width = 50;
        pop.corgi2.width = 60;
        pop.corgi3.width = 70;
        pop.corgi4.width = 80;
        pop.corgi5.width = 90;
        pop.corgi6.width = 100;
        
        pieces.O1 = pop.corgi1;
        pieces.O2 = pop.corgi2;
        pieces.O3 = pop.corgi3;
        pieces.O4 = pop.corgi4;
        pieces.O5 = pop.corgi5;
        pieces.O6 = pop.corgi6;

        pieces.O1.code = 'O1';
        pieces.O2.code = 'O2';
        pieces.O3.code = 'O3';
        pieces.O4.code = 'O4';
        pieces.O5.code = 'O5';
        pieces.O6.code = 'O6';

        pop.table = document.createElement('table');
        pop.tbody = document.createElement('tbody');

        pop.tr1 = document.createElement('tr');
        pop.tr2 = document.createElement('tr');
        pop.tr3 = document.createElement('tr');

        pop.td_1_1 = document.createElement('td');
        pop.td_1_1.row = 1;
        pop.td_1_1.col = 1;

        pop.td_1_2 = document.createElement('td');
        pop.td_1_2.row = 1;
        pop.td_1_2.col = 2;

        pop.td_1_3 = document.createElement('td');
        pop.td_1_3.row = 1;
        pop.td_1_3.col = 3;

        pop.td_2_1 = document.createElement('td');
        pop.td_2_1.row = 2;
        pop.td_2_1.col = 1;

        pop.td_2_2 = document.createElement('td');
        pop.td_2_2.row = 2;
        pop.td_2_2.col = 2;

        pop.td_2_3 = document.createElement('td');
        pop.td_2_3.row = 2;
        pop.td_2_3.col = 3;
        
        
        pop.td_3_1 = document.createElement('td');
        pop.td_3_1.row = 3;
        pop.td_3_1.col = 1;

        pop.td_3_2 = document.createElement('td');
        pop.td_3_2.row = 3;
        pop.td_3_2.col = 2;

        pop.td_3_3 = document.createElement('td');
        pop.td_3_3.row = 3;
        pop.td_3_3.col = 3;
        
        
        

        
        pop.td_1_1.onclick = selectTile;
        pop.td_1_2.onclick = selectTile;
        pop.td_1_3.onclick = selectTile;   
        pop.td_2_1.onclick = selectTile;
        pop.td_2_2.onclick = selectTile;
        pop.td_2_3.onclick = selectTile;
        pop.td_3_1.onclick = selectTile;
        pop.td_3_2.onclick = selectTile;
        pop.td_3_3.onclick = selectTile;

        pop.tr1.appendChild(pop.td_1_1);
        pop.tr1.appendChild(pop.td_1_2);
        pop.tr1.appendChild(pop.td_1_3);

        pop.tr2.appendChild(pop.td_2_1);
        pop.tr2.appendChild(pop.td_2_2);
        pop.tr2.appendChild(pop.td_2_3);
        
        pop.tr3.appendChild(pop.td_3_1);
        pop.tr3.appendChild(pop.td_3_2);
        pop.tr3.appendChild(pop.td_3_3);


        pop.tbody.appendChild(pop.tr1);
        pop.tbody.appendChild(pop.tr2);
        pop.tbody.appendChild(pop.tr3);

        pop.table.appendChild(pop.tbody);

        pop.table.classList.add('board');
        pop.table.setAttribute('border','1');

        function render(data){

            data.map((row,i)=>{
                
                let r = i+1;

                row.map((col,k)=>{

                    let c = k+1;
                    
                    pop['td_'+r+'_'+c].innerHTML = '';

                    if(typeof pieces[col] != 'undefined'){
                        pop['td_'+r+'_'+c].appendChild(pieces[col]);
                        pieces[col].onclick = ()=>{};
                    }
                    
                });

            });

        }


        
        page.appendChild(pop.table);

      


        state.player_1_options.map(item=>{
            if(typeof pieces[item] != 'undefined'){
                options1.appendChild(pieces[item]);
            
                pieces[item].onclick = function(){

                    Array.from(document.querySelectorAll('.selected')).map(item=>{
                        item.classList.remove('selected');
                    });

                    this.classList.add('selected');

                    selectedPieces = pieces[item];
                }
            }
        });
           
        state.player_2_options.map(item=>{

            if(typeof pieces[item] != 'undefined'){
                options2.appendChild(pieces[item]);

                pieces[item].onclick = function(){

                    Array.from(document.querySelectorAll('.selected')).map(item=>{
                        item.classList.remove('selected');
                    });

                    this.classList.add('selected');

                    selectedPieces = pieces[item];
                }
            }
        });
            
          
            
            
           
        function g(){


            if(state.turn == 'player1'){
                
                player_1_turn.style.display = 'inline';
                player_2_turn.style.display = 'none';
            }else{
                player_2_turn.style.display = 'inline';
                player_1_turn.style.display = 'none';
            }
            
            render([
                state.row1,
                state.row2,
                state.row3,
            ]);


           
            let winner = winningCondition();
            

            if(state.turn == 'player1'){
                options1.style.display = 'inline';
                options2.style.display = 'none';
            }else{
                options1.style.display = 'none';
                options2.style.display = 'inline';
            }

            if(state.player_1 == player){
              
           


                if(winner == 'player_1'){

                    win.play();
                    
                    modalTitle.innerHTML = 'YOU WON!';
                    modalBody.innerHTML = '';


                    if(state.player_2_bet){
                        let img = document.createElement('img');

                        img.src = state.player_2_bet;
                        img.classList.add('img-fluid');
                        download.href = state.player_2_bet;
                        download.style.display = 'inline';
                        modalBody.appendChild(img);
                    }else{
                        download.style.display = 'none';
                        modalBody.innerHTML = 'Congratulations!    ';
                    }

                    jsConfetti.addConfetti({
                        emojis: ['', '', '', '', '', ''],
                    });
                    
                    interval = setInterval(()=>{
                        jsConfetti.addConfetti({
                            emojis: ['', '', '', '', '', ''],
                        });
                    },2000);
                   
                    myModal.show();
                }else if(winner == 'player_2'){
                    
                    lose.play();
                    
                    modalTitle.innerHTML = 'YOU LOST!';
                    modalBody.innerHTML = '';
                    
                    
                    jsConfetti.addConfetti({
                        emojis: [''],
                    });
                    
                    interval = setInterval(()=>{
                        jsConfetti.addConfetti({
                            emojis: [''],
                        });
                    },2000);
                    download.style.display = 'none';
                    myModal.show();
                }else{
                    clearInterval(interval);
                }

            }else{
            
               

                if(winner == 'player_2'){

                    win.play();

                    modalTitle.innerHTML = 'YOU WON!';
                    
                    modalBody.innerHTML = '';

                    if(state.player_1_bet){
                        let img = document.createElement('img');

                        img.src = state.player_1_bet;
                        img.classList.add('img-fluid');
                        download.href = state.player_1_bet;
                        download.style.display = 'inline';
                        modalBody.appendChild(img);

                    }else{
                        modalBody.innerHTML = 'Congratulations!    ';
                        download.style.display = 'none';
                    }
                   
                    
                    jsConfetti.addConfetti({
                        emojis: ['', '', '', '', '', ''],
                    });
                    
                    interval = setInterval(()=>{
                        jsConfetti.addConfetti({
                            emojis: ['', '', '', '', '', ''],
                        });
                    },2000);
                    myModal.show();
                }else if(winner == 'player_1'){

                    lose.play();
                    
                    modalTitle.innerHTML = 'YOU LOST!';
                    modalBody.innerHTML = '';

                    jsConfetti.addConfetti({
                        emojis: [''],
                    });

                    interval = setInterval(()=>{
                        jsConfetti.addConfetti({
                            emojis: [''],
                        });
                    },2000);
                    download.style.display = 'none';
                    myModal.show();
                }else{

                    clearInterval(interval);
                }
            }//else if

        }

        g();

    })();
    </script>
</body>
</html>
